import React from 'react';

class Projects extends React.Component
{
  render()
  {
    return(
      <section className="colorlib-work" data-section="work">
          <div className="colorlib-narrow-content">
            <div className="row">
              <div className="col-md-6 col-md-offset-3 col-md-pull-3 animate-box" data-animate-effect="fadeInLeft">
                <h2 className="colorlib-heading animate-box">Projects</h2>
              </div>
            </div>
            <div className="row">
              <div className="col-md-6 animate-box" data-animate-effect="fadeInLeft">
              <a href="https://github.com/arnav149/face-recognition">
                <div className="project" style={{backgroundImage: 'url(images/img-1.jpg)'}}>
                  <div className="desc">
                    <div className="con">
                      <h3>Project 01</h3>
                      <span>Face Recognition</span>
                    </div>
                  </div>
                </div>
               </a>
              </div>
              <div className="col-md-6 animate-box" data-animate-effect="fadeInRight">
              <a href="https://github.com/arnav149/robo-friends">
                <div className="project" style={{backgroundImage: 'url(images/img-2.jpg)'}}>
                  <div className="desc">
                    <div className="con">
                      <h3><a href="work.html">Project 02</a></h3>
                      <span>Robo Friends</span>

                    </div>
                  </div>
                </div>
               </a>
              </div>
              <div className="col-md-6 animate-box" data-animate-effect="fadeInTop">
              <a href="https://github.com/arnav149/sunhacks2018speedmaster/tree/master/speed-limiter">
                <div className="project" style={{backgroundImage: 'url(images/img-3.jpg)'}}>
                  <div className="desc">
                    <div className="con">
                      <h3><a href="work.html">Project 03</a></h3>
                      <span>SpeedMaster</span>

                    </div>
                  </div>
                </div>
               </a>
              </div>
              <div className="col-md-6 animate-box" data-animate-effect="fadeInTop">
              <a href="https://github.com/arnav149/sunhacks2018speedmaster/tree/master/speed-limiter">
                <div className="project" style={{backgroundImage: 'url(images/img-3.jpg)'}}>
                  <div className="desc">
                    <div className="con">
                      <h3><a href="work.html">More to added</a></h3>
                      <span>Soon</span>

                    </div>
                  </div>
                </div>
               </a>
              </div>
            </div>
          </div>
        </section>
    )
  }
}

